import React from 'react';
import logo from './HL.ico';
import './App.css';
import { getFullYear, getFooterCopy } from './utils';

function App() {
  const isIndexPage = true; // Change this based on whether it's an index page or not

  return (
    <div className="App">
      <div className="header">
        <img src=".\HL.ico" alt="" />
        <h1 className="headertitle">School Dashboard</h1>
      </div>
      <div className="loginbox">
        <div className="infobox">
          <h1>{getFooterCopy(isIndexPage)}</h1>
        </div>
      </div>
      <footer>
        <p>Copyright {getFullYear()} - {getFooterCopy(isIndexPage)}</p>
      </footer>
    </div>
  );
}

export default App;
